import * as React from 'react';
import styles from './LayoutHeader.module.less';

interface MenuItem {
  key: string;
  label: string;
}

const MenuItems: MenuItem[] = [
  {
    key: 'aboutMe',
    label: 'About me'
  },
  {
    key: 'projects',
    label: 'Projects'
  }
];
const LayoutHeader: React.FC<{}> = () => {
  return (
    <div>
      <div className={styles['layout-menu-container']}>
        {MenuItems.map(i => ({
          ...i,
          ref: React.useRef()
        })).map(item => (
          <span
            key={item.key}
            ref={item.ref}
            className={styles['layout-menu-item']}
            onClick={()=>{
              console.log(item.ref)
            }}
          >
            {item.label}
          </span>
        ))}
      </div>
    </div>
  );
};

export default LayoutHeader;
